import React, { useState } from "react"
import MapPoint from "./MapPoint";

export default function Map() {
  let listPoints = [];

  for (let i=0; i<10; i++) {
    listPoints.push(<MapPoint label={i.toString()}/>);
  }


  return (
    <React.Fragment>
      {listPoints}
    </React.Fragment>
  );
}
